import React, { Component } from "react";
import DemoTable from "./Table";
import PropTypes from 'prop-types';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import SavageTable from "./Table";
import TableDataService from "../../Service/TableDataServices";
import CircularProgress from '@material-ui/core/CircularProgress';

class Tables extends Component {
  componentDidMount() {
    this.state.tableDataService.getTables(function (data) {
      this.setState({ tables: data.data })
      this.setState({loading: false})
    }.bind(this), function (data) {
      console.log(data)
    });
  }

  state = {
    tables: [],
    tableDataService: new TableDataService(),
    loading: true
  }

  render() {
    return (
      <>

        <TabPanel />
      </>
    );
  }
}

function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`scrollable-auto-tabpanel-${index}`}
      aria-labelledby={`scrollable-auto-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box p={3}>
          <Typography>{children}</Typography>
        </Box>
      )}
    </div>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.any.isRequired,
  value: PropTypes.any.isRequired,
};

function a11yProps(index) {
  return {
    id: `scrollable-auto-tab-${index}`,
    'aria-controls': `scrollable-auto-tabpanel-${index}`,
  };
}

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    width: '100%',
    backgroundColor: theme.palette.background.paper,
  },
}));

export default function ScrollableTabsButtonAuto() {
  const classes = useStyles();
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <div className={classes.root}>
      <AppBar position="static" color="default">
        <Tabs
          selectionFollowsFocus
          value={value}
          onChange={handleChange}
          indicatorColor="primary"
          textColor="primary"
          variant="scrollable"
          scrollButtons="auto"
          aria-label="scrollable auto tabs example"
        >
          <Tab label="Nutrition" {...a11yProps(0)} />
          <Tab label="Ingredients" {...a11yProps(1)} />
          <Tab label="Cars" {...a11yProps(2)} />
          <Tab label="Boats" {...a11yProps(3)} />
          <Tab label="Fish" {...a11yProps(4)} />
          <Tab label="Cats" {...a11yProps(5)} />
          <Tab label="Dogs" {...a11yProps(8)} />
          <Tab label="People" {...a11yProps(9)} />
          <Tab label="Items" {...a11yProps(10)} />
          <Tab label="Stock" {...a11yProps(11)} />
          <Tab label="Eggs" {...a11yProps(12)} />
          <Tab label="Days" {...a11yProps(13)} />
          <Tab label="Songs" {...a11yProps(14)} />

        </Tabs>
      </AppBar>
      <TabPanel value={value} index={0}>
        <SavageTable />
      </TabPanel>
      <TabPanel value={value} index={1}>
        <SavageTable />
      </TabPanel>
    </div>
  );
}
